import styled from 'styled-components';

import CompanyLogo from './CompanyLogo';
import SecondaryText from './SecondayText';


const JobCard = ({ data }) => {

    const JobCard = styled.div`
background: #fff;
box-shadow: 5px 5px 20px rgba(0,0,0,0.05);
border-radius: 24px;
min-height:300px;
max-width:350px;
place-items:center;
padding: 20px 30px;`

    const CompanyTitle = styled(SecondaryText)`
margin: 5px 0 ;
`

    const JobTitle = styled.h2`
font-size:16px;
line-height:20px;
font-weight: 700;

`

    const calculateTime = (createdAt) => {
        const now = new Date()
        console.log(now)
        console.log(new Date(createdAt))
        const difference = now - new Date(createdAt)
        console.log(difference / 6000 / 6000 / 24)

    }

    const Location = styled(SecondaryText)``
    const Time = styled(SecondaryText)``

    return <JobCard>
        <CompanyLogo>
            <img src={data.company_logo} alt={data.company} />
        </CompanyLogo>
        <CompanyTitle>
            {data.company}
        </CompanyTitle>
        <JobTitle>
            {data.title}
        </JobTitle>
        <Location>
            {data.location}
        </Location>
        <Time>
            {calculateTime(data.created_at)}
        </Time>


    </JobCard>
}

export default JobCard;
